class KeyData {
    private String path;
    private String group;
    private String version;

    KeyData(String path, String group, String version) {
        this.path = path;
        this.group = group;
        this.version = version;
    }

    public String getPath() {
        return path;
    }

    public String getGroup() {
        return group;
    }

    public String getVersion() {
        return version;
    }

    public int getLength() {
        return path == null ? 0
